class LandingPage extends Component {
    //call the constructor method
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <Navbar /><br/><br/><br/>
                <img src={grubhubLoginImage} style={{ height: 'fit-content', width: '60%' }} alt='GrubHub' />
                LandingPage
            </div>
        )
    }
}
//export Login Component
export default LandingPage;
